def erosion_polygon(virtices, pixels = 5):
    """Converts contour to filled binary region, performs erosion, and gives the result
    as the contour outline around the eroded region."""

    return erosion_cv(virtices, pixels/2)

    contour = get_contour_from_virtices(virtices)
    
    delta_x = contour[0][0]
    delta_y = contour[0][1]
    for i in xrange(len(contour)):
        if delta_x > contour[i][0]:
            delta_x = contour[i][0]
        if delta_y > contour[i][1]:
            delta_y = contour[i][1]
    for i in xrange(len(contour)):
        contour[i][0] = contour[i][0] - delta_x
        contour[i][1] = contour[i][1] - delta_y
   
    erosionContourList = erosion_contour(contour, pixels)
    
    count = len(erosionContourList)
    for i in xrange(count):
        length = len(erosionContourList[i])
        for j in xrange(length):
            erosionContourList[i][j][0] = erosionContourList[i][j][0] + delta_x
            erosionContourList[i][j][1] = erosionContourList[i][j][1] + delta_y
    return erosionContourList


def get_contour_from_virtices( virtices ):
    """Get contour from vertices"""

    contour = []
    length = len(virtices);
    if length < 3:
        #print "# of virtices >= 3"
        return contour
    tempvirtices = []
    for i in xrange(length):
        tempvirtices.append([0,0,0])
        tempvirtices[i][0] = virtices[i][0]
        tempvirtices[i][1] = virtices[i][1]
        tempvirtices[i][2] = virtices[i][2]        
    
    if virtices[0][0] != virtices[length-1][0] or virtices[0][1] != virtices[length-1][1]:
        tempvirtices.append([0,0,0])
        tempvirtices[length][0] = virtices[0][0]
        tempvirtices[length][1] = virtices[0][1]
        tempvirtices[length][2] = virtices[0][2]        
        length = length + 1


    oldPoint = tempvirtices[0]
    
    contour.append(oldPoint)
    zVal = tempvirtices[0][2]
    for i in range(1, length):
        curPoint = tempvirtices[i]
        #print "curPoint ", curPoint
        bY = abs(curPoint[0] - oldPoint[0]) < abs(curPoint[1] - oldPoint[1])
        if bY == True:
            frate = float(float((curPoint[0] - oldPoint[0])) / float(abs(curPoint[1] - oldPoint[1])))
            tempPoint = oldPoint
            sign = 1
            if curPoint[1] < oldPoint[1]:
                sign = -1
            for j in range(1, abs(curPoint[1] - oldPoint[1])):
                newPoint = [int(float(tempPoint[0])+frate*j), tempPoint[1]+j*sign, zVal]
                #print "new Point =", newPoint
                contour.append(newPoint)
            if tempPoint[1] != curPoint[1]:
                #print "new Point =", curPoint
                contour.append(curPoint)
        else:
            if curPoint[0] - oldPoint[0] == 0:
                continue            
            frate = float(float((curPoint[1] - oldPoint[1])) / float(abs(curPoint[0] - oldPoint[0])))
            tempPoint = oldPoint
            sign = 1
            if curPoint[0] < oldPoint[0]:
                sign = -1
            for j in range(1, abs(curPoint[0] - oldPoint[0])):
                newPoint = [tempPoint[0]+j*sign,int(float(tempPoint[1])+frate*j), zVal]
                #print "new Point =", newPoint
                contour.append(newPoint)
            if tempPoint[0] != curPoint[0]:
                #print "new Point =", curPoint
                contour.append(curPoint)
        oldPoint = curPoint
    return contour


