def do_gen_contour( inName, outName ):
    """Generate contour for testing."""

    f_in = open( inName, "r")
    firstline = f_in.readline()
    firstline = firstline.strip()
    templist = firstline.split()
    width = int(templist[0])
    height = int(templist[1])
    #print "width=",width,"height=",height
    imageBinary = []
    for oneline in f_in.readlines():
        a = []
        for i in range(0, width):
            a.append( int(oneline[i]) )
        imageBinary.append(a)
    f_in.close()
    contourList = gen_contour_from_binaryimage( imageBinary, width, height)
    #print "lenght =", len(contourList)
    f_out = open(outName, "w")
    pickle.dump(contourList[0], f_out)
    f_out.close()

